import React from "react";

export default function ProductTile({ imageSource = "" }) {
  return (
    <div
      className="m-2 p-2"
      style={{ minWidth: "25vw", height: "32vw", border: "1px solid red" }}
    >
      <img
        style={{ objectFit: "contain" }}
        width="100%"
        height="100%"
        alt="somePhoto"
        src={imageSource}
      />
      <div>
      <small>Floral Print Contrast Midi dress</small>
      <h6>₹ 570</h6>
      <p>
        <small>
          ₹<s> 1007</s>
        </small>
      </p>
      </div>
    </div>
  );
}
